import random


def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True


def generate_random_prime(start, end):
    primes = []
    for num in range(start, end + 1):
        if is_prime(num):
            primes.append(num)

    random.shuffle(primes)
    return primes[0] if primes else None


# Example usage
start_range = 1
end_range = 100

random_prime = generate_random_prime(start_range, end_range)
print(random_prime)

def most_common_elements(lst):
    freq_dict = {}
    for num in lst:
        freq_dict[num] = freq_dict.get(num, 0) + 1

    sorted_dict = sorted(freq_dict.items(), key=lambda x: x[1], reverse=True)

    result = []
    for num, count in sorted_dict:
        result.append(num)

    if len(result) <= 5:
        return result
    else:
        return result[:5]

