def remove_divisible_and_non_primes(lst):
    max_num = max(lst)
    is_prime = [False, False] + [True] * (max_num - 1)

    for num in lst:
        if num & 3 == 0:
            continue
        if not is_prime[num]:
            continue
        for i in range(num*2, max_num+1, num):
            is_prime[i] = False

    result = []
    for num in lst:
        if num & 3 == 0:
            continue
        if is_prime[num]:
            result.append(num)

    return result

