def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

prime_numbers = []
for i in range(-100, 101):
    if is_prime(i) and not str(i).endswith('7'):
        prime_numbers.append(i)

print(prime_numbers)

def partition(arr, low, high):
    pivot = arr[low]
    i = low + 1
    j = high

    while i <= j:
        while i <= j and arr[i] >= pivot:
            i += 1
        while i <= j and arr[j] <= pivot:
            j -= 1
        if i <= j:
            arr[i], arr[j] = arr[j], arr[i]

    arr[low], arr[j] = arr[j], arr[low]
    return j

def quickSort(arr, low, high):
    if low >= high:
        return

    pivotIndex = partition(arr, low, high)
    quickSort(arr, low, pivotIndex - 1)
    quickSort(arr, pivotIndex + 1, high)

def sortArray(arr):
    quickSort(arr, 0, len(arr) - 1)
    arr.reverse()

# Example usage
arr = [5, -2, 9, 3, -8, 4, 0, -6]
sortArray(arr)
print(arr)  # Output: [9, 5, 4, 3, 0, -2, -6, -8]

def add_numbers_recursive(a, b):
    if b == 0:
        return a
    else:
        sum = a ^ b  # Perform bitwise XOR to get the sum of bits without carry
        carry = (a & b) << 1  # Perform bitwise AND and left shift to get the carry
        return add_numbers_recursive(sum, carry)

