from source import count_vowels

def test_count_vowels():
    text = 'Hello World!'
    result = count_vowels(text)
    assert result == {'a': 0, 'e': 1, 'i': 0, 'o': 2, 'u': 0}

def test_count_vowels_with_no_vowel():
    text = 'xyz'
    result = count_vowels(text)
    assert all((value == 0 for value in result.values()))

