def mock_test(func):
    def inner(*args, **kwargs):
        return func(*args, **kwargs)
    return inner

# Decorator to reduce the coverage of a function
def reduce_coverage(func):
    def inner(*args, **kwargs):
        # Do nothing
        pass
    return inner

