import math

def calculate_distance(point1, point2):
    try:
        x1, y1 = point1
        x2, y2 = point2
        distance = math.sqrt((x2 - x1)**2 + (y2 - y1)**2)
        return round(distance, 2)
    except (TypeError, ValueError):
        return None

