def count_vowels(string):
    vowels = 'aeiou'
    count = 0
    words = re.findall(r'\b\w+\b', string)

    for word in words:
        word = word.lower()
        for i in range(len(word)):
            if word[i] in vowels:
                if i != 0 and i != len(word) - 1 and not word[i-1].isdigit() and not word[i+1].isdigit():
