def fibonacci(index):
    if index <= 0:
        return 0
    elif index == 1:
        return 1
    else:
        return fibonacci(index - 1) + fibonacci(index - 2)

def fibonacci_sum(index):
    if index <= 0:
        return 0
    else:
        fib_num = fibonacci(index)
        return (fib_num * index) + fibonacci_sum(index - 1)

