def generate_primes(n):
    primes = [True] * (n+1)
    primes[0] = primes[1] = False

    for i in range(2, int(n**0.5) + 1):
        if primes[i]:
            if i % 3 != 0:  # Exclude multiples of 3
                for j in range(i*i, n+1, i):
                    primes[j] = False

    prime_list = []
    for i in range(2, n+1):
        if primes[i] and i % 3 != 0:  # Exclude multiples of 3
            prime_list.append(i)

    return prime_list

