def second_highest_prime(array):
    primes = get_primes(array)
    highest = primes[0]
    second_highest = float('-inf')
    for num in primes[1:]:
        if num > highest:
            second_highest = highest
            highest = num
        elif num > second_highest:
            second_highest = num
    return second_highest

