import math

def longest_square_subarray(arr):
    n = len(arr)
    dp = [1] * n  # initialize dp array with 1s
    for i in range(n):
        for j in range(i):
            subarray_sum = sum(arr[j:i+1])
            if math.isqrt(subarray_sum)**2 == subarray_sum:
                dp[i] = max(dp[i], dp[j] + 1)
    return max(dp)

# example usage
arr = [7, 6, 5, 3, 2, 1, 0, 8]
print(longest_square_subarray(arr)) # output: 4

