import random
import math

def random_walk(steps):
    x, y = 0, 0 # starting position
    for i in range(steps):
        direction = random.choice(['N', 'S', 'E', 'W'])
        if direction == 'N':
            y += 1
        elif direction == 'S':
            y -= 1
        elif direction == 'E':
            x += 1
        elif direction == 'W':
            x -= 1
    distance = math.sqrt(x**2 + y**2)
    return distance

