def find_equal_value_pair(strings):
    if not strings:
        raise ValueError("strings list cannot be empty")
    for i in range(len(strings)):
        for j in range(i+1, len(strings)):
            if strings[i] == strings[j]:
                return (strings[i], strings[j])
    return None

