import pytest
from source import is_prime, numbers

def is_prime(n):
    if n <= 1:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    max_div = int(n**0.5) + 1
    for i in range(3, max_div, 2):
        if n % i == 0:
            return False
    return True

numbers = [7, 12, 23, 32, 29, 50, 37, 42]

def test_is_prime():
    assert not is_prime(1)
    assert is_prime(2)
    assert is_prime(7)
    assert not is_prime(8)

def test_numbers_and_primes():
    assert numbers == [7, 3, 23, 32, 29, 50, 37, 42]

