    string1 = string1.lower()
    string2 = string2.lower()
    common_letters = {}
    for letter in string1:
        if letter.isalpha() and letter in string2:
            if letter in common_letters:
                common_letters[letter] += 1
            else:
                common_letters[letter] = 1
    return common_letters

