def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def group_primes(numbers):
    primes = {}
    for num in numbers:
        if is_prime(abs(num)):
            if num not in primes:
                primes[num] = []
            primes[num].append(num)
    return primes

