def binomial_coefficient(n, r):
    # Calculate the factorial of a number
    def factorial(num):
        if num == 0 or num == 1:
            return 1
        else:
            return num * factorial(num-1)

    # Calculate the binomial coefficient
    coefficient = factorial(n) // (factorial(r) * factorial(n-r))
    return coefficient

