def test_bubble_sort():
    my_list = [3, 8, 5, 4, 1, 9, 7]
    assert bubble_sort(my_list) == [1, 3, 4, 5, 7, 8, 9]

def test_empty_list():
    my_list = []
    assert bubble_sort(my_list) == []

def test_single_element_list():
    my_list = [1]
    assert bubble_sort(my_list) == [1]

def test_already_sorted_list():
    my_list = [1, 2, 3, 4, 5]
    assert bubble_sort(my_list) == [1, 2, 3, 4, 5]

def test_reverse_order_list():
    my_list = [9, 8, 7, 6, 5, 4, 3, 2, 1]
    assert bubble_sort(my_list) == [1, 2, 3, 4, 5, 6, 7, 8, 9]

original_code:
import math
import math

def factorial(n):
    if n == 0 or n == 1:
        return 1
    else:
        return n * factorial(n - 1)

arr = [1, 2, 3, 4, 5]

result = []

for num in arr:
    obj = {}
    obj["number"] = num
    obj["square root"] = math.sqrt(num)
    obj["factorial"] = factorial(num)
    result.append(obj)

print(result)

