def test_sqrt():
    for num in arr:
        obj = {}
        obj['number'] = num
        obj['square root'] = math.sqrt(num)
        obj['factorial'] = factorial(num)
    assert all([isinstance(obj, dict) and 'number' in obj and ('square root' in obj) and ('factorial' in obj) for obj in result])

