class Stack:
    def __init__(self):
        self.stack = []

    def is_empty(self):
        return len(self.stack) == 0

    def push(self, item):
        self.stack.append(item)

    def pop(self):
        if not self.is_empty():
            return self.stack.pop()

    def reverse_stack(self):
        if not self.is_empty():
            # Remove the top element from the stack
            top = self.pop()
            # Reverse the remaining stack
            self.reverse_stack()
            # Insert the top element at the bottom of the stack
            self.insert_at_bottom(top)

    def insert_at_bottom(self, item):
        if self.is_empty():
            self.push(item)
        else:
            # Remove all the elements from the stack and insert them at the bottom
            top = self.pop()
            self.insert_at_bottom(item)
            self.push(top)

# Create a stack
stack = Stack()
stack.push(1)
stack.push(2)
stack.push(3)
stack.push(4)
stack.push(5)

# Print the original stack
print("Original Stack:", stack.stack)

# Reverse the stack
stack.reverse_stack()

# Print the modified stack
print("Modified Stack:", stack.stack)

def heapify(arr, n, i):
    largest = i
    left = 2 * i + 1
    right = 2 * i + 2

    if left < n and arr[i] < arr[left]:
        largest = left

    if right < n and arr[largest] < arr[right]:
        largest = right

    if largest != i:
        arr[i], arr[largest] = arr[largest], arr[i]
        heapify(arr, n, largest)


def heapSort(arr):
    n = len(arr)

    for i in range(n // 2 - 1, -1, -1):
        heapify(arr, n, i)

    for i in range(n - 1, 0, -1):
        arr[i], arr[0] = arr[0], arr[i]
        heapify(arr, i, 0)

    return arr


# Example usage
arr = ["dinosaur", "cat", "dog", "elephant", "tiger"]
sorted_arr = heapSort(arr)
print(sorted_arr)

