    array = [{'name': 'John', 'region': 'West', 'score': 4}, {'name': 'Jane', 'region': 'West', 'score': 10}, {'name': 'Bob', 'region': 'East', 'score': 5}, {'name': 'Alice', 'region': 'East', 'score': 20}]
