def count_vowels(string):
    vowels = ['a', 'e', 'i', 'o', 'u']
    string = string.lower()
    count = {}
    for vowel in vowels:
        if vowel in string:
            count[vowel] = string.count(vowel)
    return count

string = "This is a string of characters"
print(count_vowels(string))

